INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 7, 0.0, 0.0, 1, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 7, 0.0, 0.0, 1, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 7, 0.0, 0.0, 1, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 10, 0.0, 0.0, 1, 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 10, 0.0, 0.0, 1, 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 10, 0.0, 0.0, 1, 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2015/12/17 15:00:00", 10, 0.0, 0.0, 1, 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 0, 106401, 1, "2030/12/17 14:59:59", -363.0, 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 12, 0.0, 0.0, 1, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -416.5, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 13, 0.0, 0.0, 1, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 13, 0.0, 0.0, 1, 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2015/12/17 15:00:00", 13, 0.0, 0.0, 1, 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 0, 106401, 1, "2030/12/17 14:59:59", -363.0, 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 13, 0.0, 0.0, 1, 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 14, 0.0, 0.0, 1, 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2015/12/17 15:00:00", 14, 0.0, 0.0, 1, 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 0, 106401, 1, "2030/12/17 14:59:59", -363.0, 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 14, 0.0, 0.0, 1, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 14, 0.0, 0.0, 1, 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 15, 0.0, 0.0, 1, 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -470.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2015/12/17 15:00:00", 16, 0.0, 0.0, 1, 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 0, 106401, 1, "2030/12/17 14:59:59", -363.0, 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 16, 0.0, 0.0, 1, 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 0, 105801, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 16, 0.0, 0.0, 1, 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 16, 0.0, 0.0, 1, 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 17, 0.0, 0.0, 1, 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 0, 105901, 1, "2030/12/17 14:59:59", -363.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 25, 0.0, 0.0, 1, 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 0, 106001, 1, "2030/12/17 14:59:59", -363.0, 1);
