INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2015/12/17 15:00:00", 22, 0.0, 0.0, 1, 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 0, 190801, 1, "2030/12/17 14:59:59", -430.0, 1);
