INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 4.08, 8.0, 2, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 10011, 109001, 1, "2030/12/17 14:59:59", -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 5.0, 8.0, 2, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 10011, 109001, 2, "2030/12/17 14:59:59", -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 10.11, 8.0, 2, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 10011, 109001, 3, "2030/12/17 14:59:59", -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 4.0, 8.0, 2, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 10011, 109001, 4, "2030/12/17 14:59:59", -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 6.0, 8.0, 2, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 10011, 109001, 5, "2030/12/17 14:59:59", -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 10011, 109002, 6, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 10011, 109002, 7, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 10011, 109002, 8, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 10011, 109002, 9, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 10011, 109002, 10, "2030/12/17 14:59:59", 0.0, 1);
